import React from 'react';

function Posts({ user }) {
    return (
        <div className="container" style={{ padding: 40, textAlign: 'center' }}>
            <h2>Posts</h2>
            <p>Here you will see posts from you and your friends.</p>
        </div>
    );
}

export default Posts;
